import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { auth, signInWithEmailAndPassword, createUserWithEmailAndPassword, GoogleAuthProvider, signInWithPopup } from "./firebase";

export default function Login() {
  const navigate = useNavigate();
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  async function emailLogin() {
    try {
      await signInWithEmailAndPassword(auth, email, password);
      const token = await auth.currentUser.getIdToken(true);
      if (token) {
        localStorage.setItem("@token", token);
        navigate("/book-list");
      }
    } catch (error) {
      console.log(error);
    }
  }

  async function emailRegister() {
    try {
      await createUserWithEmailAndPassword(auth, email, password);
      const token = await auth.currentUser.getIdToken(true);
      if (token) {
        localStorage.setItem("@token", token);
        navigate("/book-list");
      }
    } catch (error) {
      console.log(error);
    }
  }

  async function googleLogin() {
    const provider = new GoogleAuthProvider();
    try {
      const result = await signInWithPopup(auth, provider);
      const token = await auth.currentUser.getIdToken(true);
      if (token) {
        localStorage.setItem("@token", token);
        navigate("/book-list");
      }
    } catch (error) {
      console.log(error);
    }
  }

  return (
      <div className="background" style={{ width: '430px', height: '520px', position: 'absolute', transform: 'translate(-50%,-50%)', left: '50%', top: '50%' }}>
          <div className="shape" style={{ height: '200px', width: '200px', position: 'absolute', borderRadius: '50%', background: 'linear-gradient(#1845ad, #23a2f6)', left: '-80px', top: '-80px' }}></div>
          <div className="shape" style={{ height: '200px', width: '200px', position: 'absolute', borderRadius: '50%', background: 'linear-gradient(to right, #ff512f, #f09819)', right: '-30px', bottom: '-80px' }}></div>
          <form style={{ height: '520px', width: '400px', backgroundColor: 'rgba(255,255,255,0.13)', position: 'absolute', transform: 'translate(-50%,-50%)', top: '50%', left: '50%', borderRadius: '10px', backdropFilter: 'blur(10px)', border: '2px solid rgba(255,255,255,0.1)', boxShadow: '0 0 40px rgba(8,7,16,0.6)', padding: '50px 35px' }}>
              <h3 style={{ fontSize: '32px', fontWeight: '500', lineHeight: '42px', textAlign: 'center' }}>Login Here</h3>

              <label htmlFor="username" style={{ display: 'block', marginTop: '30px', fontSize: '16px', fontWeight: '500' }}>Username</label>
              <input type="text" placeholder="Email or Phone" id="username" style={{ display: 'block', height: '50px', width: '100%', backgroundColor: 'rgba(255,255,255,0.07)', borderRadius: '3px', padding: '0 10px', marginTop: '8px', fontSize: '14px', fontWeight: '300' }} />

              <label htmlFor="password" style={{ display: 'block', marginTop: '30px', fontSize: '16px', fontWeight: '500' }}>Password</label>
              <input type="password" placeholder="Password" id="password" style={{ display: 'block', height: '50px', width: '100%', backgroundColor: 'rgba(255,255,255,0.07)', borderRadius: '3px', padding: '0 10px', marginTop: '8px', fontSize: '14px', fontWeight: '300' }} />

              <button style={{ marginTop: '50px', width: '100%', backgroundColor: '#ffffff', color: '#080710', padding: '15px 0', fontSize: '18px', fontWeight: '600', borderRadius: '5px', cursor: 'pointer' }} onClick={emailLogin}>Log In</button>
              <div className="social" style={{ marginTop: '30px', display: 'flex' }}>
                  <div className="go" style={{ background: 'red', width: '150px', borderRadius: '3px', padding: '5px 10px 10px 5px', backgroundColor: 'rgba(255,255,255,0.27)', color: '#eaf0fb', textAlign: 'center' }} onClick={googleLogin}><i className="fab fa-google"></i> Google</div>
                  <div className="fb" style={{ marginLeft: '25px', background: 'red', width: '150px', borderRadius: '3px', padding: '5px 10px 10px 5px', backgroundColor: 'rgba(255,255,255,0.27)', color: '#eaf0fb', textAlign: 'center' }}><i className="fab fa-facebook"></i> Facebook</div>
              </div>
          </form>
      </div>
  );
}
